import { useState }  from  'react'


const App = () => {
   const [data, setdata] = useState([
     {
       id: 1,
       name: "vineesha",
     },
     {
       id: 2,
       name: "Bhavani",
     },
     {
       id: 3,
       name: "Sirisha",
     },
     {
       id: 4,
       name: "Samatha",
     },
   ]);
  return (
    <div>
      {
        data.map((dta,i)=>{
          return(
            <>
            <h5>{dta.name}</h5>
            <button></button>
            </>
          )
        })
      }
    </div>
  )
}

export default App
